/* code block 4 */
import { Link } from 'react-router-dom';

const Navbar = () => {

    return(
        <header>
            <div className='container'>
                <nav>
                    <div>
                        <Link to="/login">Login</Link>
                        <Link to="/signup">SignUp</Link>
                    </div>
                </nav>

            </div>

        </header>
    )

}

export default Navbar;
